$("#test")
  .off()
  .on("click", "a", function (e) {
      console.log(e)
    const targetId = this.id;
    let options = JSON.parse(e.delegateTarget.dataset.data).options;
    if (typeof options === "string") {
      options = JSON.parse(options);
    }
    function findEvent(datas) {
      for (let item of datas) {
        if (item.children.length) {
          findEvent(item.children);
        }
        if (item.id === targetId) {
          if (typeof item.click === "string") {
            item.click = JSON.parse(item.click);
          }
          if (Array.isArray(item.click)) {
            item.click.forEach((target) => $(`#${target}`).click().show());
          }
        }
      }
    }
    findEvent(options);
  });
